import './index.css'
import {Container} from "react-bootstrap"
import NavBar from "./Components/NavBar";
import Title from "./Components/Title";
import Category from "./Components/Category";
import Card from './CardList';

function App() {
  return (
    <div className="color-body">
      <NavBar/>
      <Container>
     <Title/>
     <Category/>
     <Card/>
      </Container>
    </div>
  );
}

export default App;
